var Matriz = new Array()

module.exports = {
    mostrarMatriz: function (Vertices, Aristas) {
        console.log(Vertices)
        console.log(Aristas)
      },

    tipoGrafo: function (Vertices, Aristas) {
        for (let i = 0; i < Aristas.length; i++) {
            console.log(`from ${Aristas[i].from} to ${Aristas[i].to}`)
        }
    },

